import React, { useState, useEffect} from 'react'

function App() {
  const [data, setData] = useState()

  useEffect(() => {
    fetch("/page1/").then((res) => res.json()).then(
      data => {
        setData(data)
        console.log(data)
      }
    )
  }, [])

  return (
    <div>
      {(typeof data.pages === 'undefined') ? (
        <p>Synching</p>
      ):(
        data.pages.map(page => (
          <li>{page}</li>
        ))
      )}
    </div>
  )
}

export default App;
